script: |
  super -f text -I q6116.spq | sort > q6116.out

inputs:
  - name: q6116.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN - col2 AND col0 + + + col0 + col0 * - + col0;
  - name: tab1

outputs:
  - name: q6116.out
    data: |
      51	14	96
      85	5	59
      91	47	68
